const editGrid = instance.root.getComponent('entities');
if (!editGrid || !Array.isArray(editGrid.editRows)) return;
const entityCounts = {
  vehicle: 0,
  pedestrian: 0,
  cyclist: 0
};

function findComponentRecursive(components, key) {
  for (const comp of components) {
    if (comp.component && comp.component.key === key) {
      return comp;
    }
    if (Array.isArray(comp.components)) {
      const nested = findComponentRecursive(comp.components, key);
      if (nested) return nested;
    }
  }
  return null;
}

editGrid.editRows.forEach(rowInstance => {
  const entityTypeComp = findComponentRecursive(rowInstance.components, 'entity_type');
  const entityNumComp = findComponentRecursive(rowInstance.components, 'entity_num');

  if (entityTypeComp && entityNumComp) {
    const entityType = (entityTypeComp.getValue() || '').toLowerCase();
    let baseNumber = 0;

    if (["vehicle", "pedestrian", "cyclist"].includes(entityType)) {
      if (entityType === 'vehicle') baseNumber = 1;
      if (entityType === 'cyclist') baseNumber = 20;
      if (entityType === 'pedestrian') baseNumber = 30;

      const sequence = baseNumber + entityCounts[entityType];
      const padded = sequence.toString().padStart(2, '0');
      entityNumComp.setValue(padded);
      entityCounts[entityType]++;
    } else {
      entityNumComp.setValue('');
    }
  }
});

editGrid.redraw();

